class Profile extends Component {
state ={
Name:"xiao",
Gender:"Female",
Work:"IT industry",
Websit:"./my-profile"

};
 render(){
return (<div>
        <h1>Name:{this.state.Name}</h1>
        <h1>Gender:{this.Gender}</h1>
         <h1>Work:{this.Work}</h1>
         <h1>Websit:{this.Websit}</h1>
        </div>

);

 }

}

export default Profile;
